import PropTypes from 'prop-types'
import { connect } from 'react-redux'

import Header from './header/header'
import UserItemsView from './useritemsview';
import FormNav from './widgets/form-nav';

const App = ({ username, websceneItems }:any) => (
  <div className="container">
    <Header />
    <div className="app-main">
      <UserItemsView />
      {username && <div className="app-widgets">
        <FormNav />
      </div>}
    </div>
  </div>
)

App.propTypes = {
  name: PropTypes.string,
  websceneId: PropTypes.string,
}

App.defaultProps = {
  name: null,
  websceneId: null,
}

const mapStateToProps = ({ webscene: { name } }:any) => ({
  name,
})

export default connect(mapStateToProps)(App)
